import React from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";
import Head from "next/head";

// 페이지별로 공통적인 것 처리

const App = ({ Component }) => {
    return (
        <>
            <Head>
                <title>ParkJinho</title>
            </Head>
            <Component></Component>
        </>
    );
};

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
};

export default App;
